import React from 'react';
import hc from './Header.module.css'
import {NavLink} from "react-router-dom";
import AccountIconComponent from "./AcountIcon";
import {LogOutThunk} from "../../data/AuthReducer";






const Header = (props) => {

    return <header className={hc.header}>
        <div className={hc.item}>
            {props.IsLogined
                ?
                <div className={hc.AccountIconPosition}>
                    <AccountIconComponent LogOutThunk={LogOutThunk}
                                          UserProfile={props.UserProfile} />

                </div>

                :
            <NavLink className={hc.log} to={'/login'} > Login </NavLink>}
        </div>
    </header>

}
export default Header;
